import React, { Component } from 'react'
import './ReadRoom.css'
class ReadRoom extends React.Component {
    render(){
        return(
            <div className="container-fluid"> 
            <div className='row' style={{height:'100vh'}}>
                <div className="col-sm-3" id="audioplayer">
<br/>           You are listening to {this.props.title}<br/>
                <iframe style={{width:'100%'}}
                src={`https://www.youtube.com/embed/${this.props.id}?autoplay=1`}
                frameborder="0" 
                allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" 
                allowfullscreen></iframe>




                </div>


                <div className="col-sm-6" id="notes">
                    <input type="textarea" style={{border:'0px', width:'100%', height:''}}></input>
                </div>


                <div className="col-sm-3" id="dictionary"></div>
            </div>
            </div>
        )
    }
}

export default ReadRoom;
